INSERT INTO `inquiry` VALUES (15,15,'','ㅁㅀ','ㅁㅀㅇ','2024-08-14 02:14:34'),(30,27,'','비 엄청온다..','비 그치면 좋겠다...\n그치진 않더라도 집 갈 땐 좀 수그러들면 좋겠다... ㅋㅋ','2024-08-14 07:53:40'),(31,6,'','집가고싶다..','휴일동안 쉬지를 못했어.. 휴일 시작 당일부터 아팠어서... 말할때 목에서 바람소리 나더니 목 아파지고.. 목 완전히 나갔고.. 목 좀 괜찮아지니 이제 콧물이 나기 시작하고 기침하기 시작하고... 기침이 끝나니까 그 날이 시작되네.. ㅋㅋ..','2024-08-19 00:15:51'),(35,27,'https://firebasestorage.googleapis.com/v0/b/kitri-final-project.appspot.com/o/images%2F%EB%A8%80%ED%88%AC.gif?alt=media&token=172b6891-ae78-45e7-bd47-28349f507348','나도 작성 할거 냥!','살랴죠라냥','2024-08-20 09:02:52'),(37,27,'https://firebasestorage.googleapis.com/v0/b/kitri-final-project.appspot.com/o/images%2F%EB%A8%80%EC%98%A4%20%EB%A6%AC%EC%A7%80%EA%B0%9C.png?alt=media&token=98b405c4-9cd4-431c-b7c7-e3f19a35f82d','테스트 중 냥','먀옹ㅇㅇㅇㅇ\n냥 냐냥 냥','2024-08-22 01:07:39'),(38,34,'','발견 된 문제!(문제 발견 시 계속 추가)','2. 후기\n2-1. 닉네임이 안뜨고 id가 뜸\n\n1,2. 피드랑 후기(의사 QnA도 인가?) 무한스크롤. 그 백엔드 딴에선 페이징 api 개발 다 해놓았는데, 프론트 딴에선 아직 안만들었다. (백엔드도 수정해야 될 수도?)\n\n3. 피드 댓글\n3-1. 작성자가 빈 란으로 나온다. (다시들어가면 제대로 나옴)\n3-2. 작성시간이 빈 란으로 나온다. (다시들어가면 제대로 나옴)\n3-3. 작성 후 바로 삭제 시 다시 로그인 해야한다 뜬다. (다시들어가면 제대로 됨)\n3-+.댓글 수정 없음.\n\n4. 후기 댓글\n4-1. 작성자가 빈 란으로 나온다. (다시들어가면 제대로 나옴)\n4-2. 작성시간이 빈 란으로 나온다. (다시들어가면 제대로 나옴)\n4-3. 작성 후 바로 삭제 시 다시 로그인 해야한다 뜬다. (다시들어가면 제대로 됨)\n4-4. 댓글 작성자가 아니어도 삭제가 가능하다.\n4-+. 댓글 수정 없음.\n\n5. 반려동물 정보\n5-1. 다른 사람의 반려동물까지 다 나온다.\n\n6. 문의페이지\n6-1. 답변추가할때 수정하는게 나온다. (새로고침하면 됨)\n\n+))큰 문제는 아닌데, 원래 있던 계정을 탈퇴하고 그 계정과 같은 username으로 회원가입을 할때, \"java.sql.SQLIntegrityConstraintViolationException: Duplicate entry \'tetetest\' for key \'user.username_UNIQUE\' 오류가 발생했습니다. 이는 데이터베이스의 user 테이블에 대해 유니크 제약 조건이 걸려 있는 username 필드에 이미 존재하는 값(tetetest)을 다시 삽입하려고 해서 발생하는 문제\" springboot 에서 오류 메시지가(메시지만) 뜬다. 회원가입은 잘 된다.\n+))이것도 큰 문제는 아닌데, 탈퇴 후 바로 들어가면 그 탈퇴된 계정을 찾을 수 없다고 springboot 에서 오류메시지(메시지만) 뜬다. 탈퇴 잘된다.\n+))ROLE_ADMIN은 탈퇴 안됨. (DB에서 삭제)','2024-08-22 06:27:13'),(39,27,'https://firebasestorage.googleapis.com/v0/b/kitri-final-project.appspot.com/o/images%2F%EC%9D%98%EC%82%AC%ED%99%94%EC%9B%90.png?alt=media&token=4645afe6-2ae2-4c5b-9d98-af9e16ece3e1','뭉냥이냥','뭉냥이다냥\n귀엽다냥','2024-08-22 10:16:22'),(40,27,'https://firebasestorage.googleapis.com/v0/b/kitri-final-project.appspot.com/o/images%2F33bc576106ef0d34.png?alt=media&token=4eff23dc-2e24-4f03-a414-143213547362','라츄냥','라츄다냥','2024-08-23 07:18:13');
